import React, {useState, useEffect} from 'react';
import axios from 'axios';
import './App.css';
import DisplayComponent from './DisplayComponent';
function FetchUser() {
    const [posts, setPosts] = useState([])

    useEffect(() => {
        axios.get('https://api.spaceXdata.com/v3/launches?limit=100')
        .then(res => {
            console.log(res)
            setPosts(res.data)
        })
        .catch(err =>{
             console.log(err)
        })
    },[])

